    true,nt"url": null,nt"notes": "<p>Adequate pain management is an important
    indicator of quality of care and quality of life. Nursing home staff should check
    patients regularly to see if they are experiencing pain. If pain is not treated,
    a resident may not be able to perform daily routines, may become depressed, or may
    have an overall poor quality of life. The reported percentage may include some residents
    who are getting or who have been prescribed treatment for their pain, but who refuse
    pain medicines or choose to take less.</p>n",nt"license_title": "Other License
